    [],nt"num_tags": 5,nt"name": "great-bay-national-wildlife-refuge-annual-narrative-report-calendar-year-1993",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Great
    Bay Wildlife Management Area outlines Refuge accomplishments during the 1993 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    The report includes a planning section which discusses research and investigations.
    Refuge administration is outlined; information about personnel, youth programs,
    other manpower programs, volunteer programs, funding, and safety is given. Habitat
    management is also covered; subjects include wetlands, forests, grasslands, fire
    management, and pest control. The wildlife section of the report discusses wildlife
    diversity, endangered and threatened species, waterfowl, marsh and water birds,
    shorebirds, raptors, other migratory birds, game mammals, other resident wildlife,
    and fisheries resources. The public uses of the Refuge described in this report
    include interpretive programs, hunting, and law enforcement. The equipment and facilities
    section of the report provides information about new construction, rehabilitation,
    equipment utilization and replacement, communications systems, and computer systems.
    Refuge brochures are attached. Items of interest are included.",nt"owner_org":
